function MagicScan(symbology, barcode)
{
  // Object returned can be a Modified barcode
  var rv = { accept: false, adjBarcode: barcode };

  // Turn Symbology Number to Text
  var symbologyText=Symbology2Text[symbology];

  // Quick Lookup patterns that match the right length
  var len = barcode.length;
  var patterns = Len2PatternIndex[len]; // Find patterns that allow for this length

  // See if any Pattern qualifies
  for ( var key in patterns )
  {
  	// Quick Lookup Regular Expression
    var pattern = patterns[key]; // this is how we get the pattern id
    var re = RE[pattern];  // now get the corresponding pre-compiled RE

    // Full Pattern Object
    var patternObj = Patterns[pattern];

    // Symbology nneds to match and Regular Expression needs to match
    if ( patternObj.SYMBOLOGIES.indexOf(symbologyText) >= 0 && re.test(barcode) )  // Is there a pattern match?
    {
       // Service Type needs to match (if present)          
       if ( patternObj.STStart==0 && patternObj.STEnd == 0 ) return true;
       var ST=barcode.substring(patternObj.STStart - 1, patternObj.STEnd );
       var ok = patternObj.ST.includes(ST); // is there a Service Match?
       if (ok) { rv.accept=true; return rv; }  // For now, return barcode unscrubbed
    }
  }
  return rv; // default, no pattern produce a valid ST
}